import React from 'react';
import { NavLink } from 'react-router-dom';

const Navigation = () => {
  return (
    <nav className="main-nav">
      <ul>
        <li><NavLink to="/mountain">Munte</NavLink></li>
        <li><NavLink to="/beach">Plaje</NavLink></li>
        <li><NavLink to="/bird">Păsări</NavLink></li>
        <li><NavLink to="/food">Alimente</NavLink></li>
      </ul>
    </nav>
  );
}

export default Navigation;
